		return $service;
	}


	/**
	 * @return Nette\Security\Permission
	 */
	protected function createServiceAuthorizator()
	{
		$service = new Nette\Security\Permission;
		$service->addRole('member');
		$service->addRole('fotographer');
		$service->addRole('video');
		$service->addRole('writer', array(
			'fotographer',
			'video',
		));
		$service->addRole('admin');
		$service->addResource('Admin:Default');
		$service->addResource('Admin:GalleryManager');
		$service->addResource('Admin:VideoManager');
		$service->addResource('Admin:ArticleManager');
		$service->addResource('Admin:CategoryManager');
		$service->addResource('Admin:PageManager');
		$service->addResource('Admin:ImageManager');
		$service->addResource('Admin:HomeBlockManager');
		$service->addResource('Admin:PluginManager');
		$service->addResource('Admin:DriftManager');
		$service->addResource('Admin:EventManager');
		$service->allow('video', 'Admin:VideoManager');
		$service->allow('fotographer', 'Admin:ImageManager');
		$service->allow('writer', 'Admin:Default');
		$service->allow('writer', 'Admin:ArticleManager');
		$service->allow('writer', 'Admin:PageManager');
		$service->allow('admin');
		return $service;
	}


